script: |
  super -f text -I q8828.spq | sort > q8828.out

inputs:
  - name: q8828.spq
    data: |
      SELECT ALL col1 FROM tab0 (FORMAT parquet) WHERE NOT - ( - - 80 ) BETWEEN col1 AND 85 * - col2 * + - col2 * col1 + 5;
  - name: tab0

outputs:
  - name: q8828.out
    data: |
      1
      21
      81
